import React from 'react'

import {GetAllProject} from '../HuddleComponents/GetAllProjects.js';
import {GetAllTickets} from '../HuddleComponents/GetAllTicketFromApi.js';
import {NewTicktForm} from '../HuddleComponents/GetNewTicketForm.js';
import {GetAllMemberDevelopers} from '../HuddleComponents/GetAllMemberDevelopers.js';
export default function LeftNav() {
    let outerDivCss = {
        display: "flex",
        position: "relative",
        height: "600px",
        overflowY: "scroll",
        width: "100"
    }
    let leftNavPartCss = {
        borderRight: "4px solid green"
    }
    let leftNavButtonsCss = {
        marginTop: "50px",
        marginRight : "5px"
    }
    return (
        <div style={outerDivCssouterDivCss} className="d-flex align-items-start">
            <div style={leftNavPartCss}className="nav flex-column nav-pills me-3" id="v-pills-tab" role="tablist" aria-orientation="vertical">
                <button style={leftNavButtonsCss} className="nav-link active" id="v-pills-home-tab" data-bs-toggle="pill" data-bs-target="#v-pills-home" type="button" role="tab" aria-controls="v-pills-home" aria-selected="true">All tickets</button>
                <button style={leftNavButtonsCss} className="nav-link" id="v-pills-profile-tab" data-bs-toggle="pill" data-bs-target="#v-pills-profile" type="button" role="tab" aria-controls="v-pills-profile" aria-selected="false">Create ticket</button>
                <button style={leftNavButtonsCss} className="nav-link" id="v-pills-messages-tab" data-bs-toggle="pill" data-bs-target="#v-pills-messages" type="button" role="tab" aria-controls="v-pills-messages" aria-selected="false">Members</button>
                <button style={leftNavButtonsCss} className="nav-link" id="v-pills-settings-tab" data-bs-toggle="pill" data-bs-target="#v-pills-settings" type="button" role="tab" aria-controls="v-pills-settings" aria-selected="false">Buckets Available</button>
            </div>
            <div className="tab-content" id="v-pills-tabContent">
                <div className="tab-pane fade show active" id="v-pills-home" role="tabpanel" aria-labelledby="v-pills-home-tab"><GetAllTickets/></div>
                <div className="tab-pane fade" id="v-pills-profile" role="tabpanel" aria-labelledby="v-pills-profile-tab"><NewTicktForm/></div>
                <div className="tab-pane fade" id="v-pills-messages" role="tabpanel" aria-labelledby="v-pills-messages-tab"><GetAllMemberDevelopers/></div>
                <div className="tab-pane fade" id="v-pills-settings" role="tabpanel" aria-labelledby="v-pills-settings-tab"><GetAllProject/></div>
            </div>
        </div>
    )
}
